Ext.data.JsonP['Hyperloop_2.1.1_Release_Note']({"guide":"<?xml version=\"1.0\" encoding=\"UTF-8\" ?>\n<!DOCTYPE html PUBLIC \"-//W3C//DTD XHTML 1.0 Transitional//EN\"\n        \"http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd\">\n<html xmlns=\"http://www.w3.org/1999/xhtml\">\n<head>\n    <title>Hyperloop 2.1.1 - 2 June 2017</title>\n\n    <meta http-equiv=\"Content-Type\" content=\"text/html; charset=UTF-8\">\n    <meta content=\"Scroll EclipseHelp Exporter\" name=\"generator\">\n\n    <link type=\"text/css\" rel=\"stylesheet\">\n    <link type=\"text/css\" rel=\"stylesheet\">\n    <link type=\"text/css\" rel=\"stylesheet\" media=\"print\">\n</link></link></link></meta></meta></head>\n<body>\n    <div class=\"container\">\n\t\t<div id=\"banner\" class=\"confbox admonition admonition-note aui-message warning shadowed information-macro\">\n\t\t\t<p>You can now find Appcelerator documentation at <a href=\"https://docs.axway.com/\" target=\"_blank\">https://docs.axway.com/</a>. This site will be taken down in the near future.</p></div>\n        <div class=\"header\"/>\n\n        <div id=\"src-49162327\" class=\"content\">\n                        <h1>Hyperloop 2.1.1 - 2 June 2017</h1>\n    <p>Hyperloop 2.1.1 is a patch release that includes several bug fixes.    </p>\n    <div class=\"section section-2 \" id=\"src-49162327_Hyperloop2.1.1ReleaseNote-Fixedissues\">\n        <h2 class=\"heading \"><span>Fixed issues</span></h2>\n<ul class=\" \"><li class=\" \">    <p><a class=\"external-link external-link\" href=\"https://jira.appcelerator.org/browse/TIMOB-24720\" target=\"_blank\">TIMOB-24720</a> - iOS: Error when using ES6 keywords with Hyperloop enabled    </p>\n</li><li class=\" \">    <p><a class=\"external-link external-link\" href=\"https://jira.appcelerator.org/browse/TIMOB-24646\" target=\"_blank\">TIMOB-24646</a> - Windows: Hyperloop List.Item (indexer) property does not work    </p>\n</li><li class=\" \">    <p><a class=\"external-link external-link\" href=\"https://jira.appcelerator.org/browse/TIMOB-24637\" target=\"_blank\">TIMOB-24637</a> - Windows Hyperloop: accessing generic collections throws exception    </p>\n</li><li class=\" \">    <p><a class=\"external-link external-link\" href=\"https://jira.appcelerator.org/browse/TIMOB-24291\" target=\"_blank\">TIMOB-24291</a> - Hyperloop: iOS - Unable to specify Hyperloop argument type for NSDictionary    </p>\n</li><li class=\" \">    <p><a class=\"external-link external-link\" href=\"https://jira.appcelerator.org/browse/TIMOB-24013\" target=\"_blank\">TIMOB-24013</a> - Hyperloop: Android - Not recognizing all classes from .aar    </p>\n</li><li class=\" \">    <p><a class=\"external-link external-link\" href=\"https://jira.appcelerator.org/browse/TIMOB-23899\" target=\"_blank\">TIMOB-23899</a> - Hyperloop: iOS - Swift metabase parser can&apos;t handle open access level keyword    </p>\n</li></ul>    </div>\n        </div><a id=\"editButton\" href=\"https://wiki.appcelerator.org/pages/editpage.action?pageId=49162327\"><span>Edit</span></a>\n    \n        \n    </div>\n</body>\n</html>\n","title":"Hyperloop 2.1.1 Release Note"});